import Card from './Card';
import images from '../images.json';
import "../styles/main.css";


function Main() {
    return (
        <div className="container">
            <div className="card-deck">

            </div>
            <div className="row row-cols-3">
                <Card 
                    id={images[i].id}
                    src={images[i].src}
                    alt={images[i].alt}
                    isClicked={images[i].isClicked}
                />
            </div>
        </div>
    );
  }

  export default Main;
